const axios = require;


axios({
    "method":"GET",
    "url":"https://travelpayouts-travelpayouts-flight-data-v1.p.rapidapi.com/v1/airline-directions",
    "headers":{
    "content-type":"application/octet-stream",
    "x-rapidapi-host":"travelpayouts-travelpayouts-flight-data-v1.p.rapidapi.com",
    "x-rapidapi-key":"c573d899fbmsh7f790eccbfa07a7p17edf7jsnf6b3cf11be53",
    "useQueryString":true
    },"params":{
    "limit":"100",
    "airline_code":"SU"
    }
    })
  .then((data) => {
    console.log(data);
  })
  .catch((error) => {
    console.log(error);
  });
